import React, { Component } from "react";
import TestNav from "./components/TestNav";
import BottomNav from "./components/BottomNav";
import "./App.css";
import AvatarBar from "./components/AvatarBar";
import Goals from "./components/Goals";
import Test from "./components/Test";

import "./components.css";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemSecondaryAction from "@material-ui/core/ListItemSecondaryAction";
import ListItemText from "@material-ui/core/ListItemText";
import IconButton from "@material-ui/core/IconButton";
import Checkbox from "@material-ui/core/Checkbox";
import Switch from "@material-ui/core/Switch";
import DeleteIcon from "@material-ui/icons/Delete";
import Divider from "@material-ui/core/Divider";

var cars = [
  "Find online prep course",
  "Spend 1 hour studying for GED exam",
  "Read for 1 hour",
  "Review completed practice exam",
  "Order study materials online",
  "Create flashcards",
  "Practice using computer",
  "Check exam locations",
  "Prepare proper identification",
  "Take a practice GED exam",
  "Register for the GED exam",
];

class App extends Component {
  state = {};
  render() {
    return (
      <div style={{ width: "100%" }}>
        <TestNav></TestNav>
        <div className="first">
          <p>Education</p>
        </div>

        <div className="category-list">
          <List>
            <Divider />
            <ListItem>
              <Checkbox></Checkbox>
              <ListItemText primary={cars[0]} />
              <ListItemSecondaryAction>
                <Switch />
              </ListItemSecondaryAction>
            </ListItem>
            <Divider />
            <ListItem>
              <Checkbox></Checkbox>
              <ListItemText primary={cars[0]} />
              <ListItemSecondaryAction>
                <Switch />
              </ListItemSecondaryAction>
            </ListItem>
          </List>

        </div>
        <BottomNav></BottomNav>
      </div>
    );
  }
}

export default App;
